INSERT INTO `atendimentos_atendimento` VALUES (42,'2025-00010','Assuntos do Gabinete','Assuntos do Gabinete','CONCLUIDO','2025-06-30 11:10:59.739171','2025-07-02 12:35:27.108564',43,13,1,1),(45,'2025-00012','Solicitando ajuda','Solicita cobertor e agasalhos (roupas)','ENCAMINHADO','2025-07-01 16:59:22.873712','2025-07-01 16:59:31.374922',50,13,1,NULL),(51,'2025-00013','Assuntos do Gabinete','Assuntos do Gabinete','CONCLUIDO','2025-07-02 11:39:05.595114','2025-07-02 11:39:20.056721',47,1,1,NULL),(58,'2025-00014','Visita','Veio a convite do Sérgio para conhecer e tomar um café.','ABERTO','2025-07-02 13:00:00.803325','2025-07-02 13:00:14.053748',54,8,1,15),(59,'2025-00015','Visita em agradecimento','Chegou para visitar o Sérgio para agradecer pela efetivação de sua filha Patrícia no emprego novo, e também pela intercessão de Sérgio na cirurgia de seu filho Edson! A sra. Aparecida, vulgo Cidinha, compareceu a esta recepção mas pediu apenas para deixar o recado ao Sérgio, uma vez que tinha um agendamento no Procon e não havia tempo hábil para aguardá-lo sem que perdesse o atendimento do Procon.','ABERTO','2025-07-02 13:11:17.203385','2025-07-02 13:11:17.203419',56,8,1,15),(60,'2025-00016','Melhorias da Cidade','Veio ao gabinete querendo colaborar com ideias para melhorias da cidade.','ABERTO','2025-07-02 13:13:19.625234','2025-07-02 13:13:19.625266',53,8,1,15),(61,'2025-00017','Visita','O padre Lucas veio para visitar dona Neusa, mas na ocasião não se encontrava pois a mesma estaria acompanhando a prefeita Mara em um evento em Jundiapeba, sendo assim, o mesmo preferiu retornar em outro momento.','ABERTO','2025-07-02 14:26:47.612118','2025-07-02 16:01:37.385154',57,13,1,15),(62,'2025-00018','Reclamação atendimento do Bom Prato','Sr. João, chegou reclamando do mal atendimento do Bom Prato, explicou que na data de hoje, por volta das 11:10 enquanto almoçava, um colega que estava menos agasalhado reclamou do frio que fazia e que então, o colega pediu para a nutricionista que ali labutava, que fizesse a gentileza de desligar o aparelho. A nutricionista, com descaso, simplesmente se negou e ainda concluiu expressando: \"Não desligamos o ventilador, devido ao mal odor, que vem das pessoas que não tomam banho\"(SIC), ademais houve-se um desentendimento naquele local, e o sr. João chegou até a prefeitura buscando um atendimento onde gostaria de realizar uma ouvidoria, porém, não concluiu o protocolo uma vez que se faz necessário passar alguns dados (normas da ouvidoria) mas o requerente não concordou, logo então, veio até o 3º andar, para tentar um atendimento com o Sérgio, mas o mesmo não se encontrava, da qual GCM Fernanda prestou os primeiros atendimentos, realizou uma ligação na ouvidoria e conversou com Ariane para entender a não conclusão do protocolo, e ali foi informado que existe uma lei federal da qual impede que as reclamações sejam anônimas, sendo necessário passar alguns dados pessoais. Logo então GCM Fernanda tentou ligar no Bom Prato para obter o nome da Nutricionista da ocasião, no tel 4729-5302, porém sem sucesso, logo repassou a explicação da ouvidoria, o requerente entendeu e agradeceu, mas que ainda sim gostaria de obter algum atendimento de Sérgio, e que se possível Sergio puder ligar, ele agradece.','ABERTO','2025-07-02 17:24:48.785659','2025-07-02 17:24:48.785689',58,8,1,15),(63,'2025-00019','Sugestões para melhorias','O Sr. Roberto veio até o gabinete querendo um atendimento pois gostaria de contribuir, para com ideias em melhorias para a cidade no geral. Logo, o Sérgio não estava para atendê-lo, mas foi criado este protocolo para criar um lembrete, para um posterior atendimento.','ABERTO','2025-07-02 17:28:45.771088','2025-07-02 17:28:45.771121',59,8,1,15),(64,'2025-00020','Referente ao filho','Neste gabinete chegou Willian procurando atendimento com Sérgio, para tratar sobre assuntos de seu filho. Foi orientado que Sérgio havia saído para almoço, então o requerente pediu para deixar anotado, pois voltaria em outra oportunidade.','ABERTO','2025-07-02 17:34:01.931202','2025-07-02 17:34:01.931227',60,8,1,15),(65,'2025-00021','Visita','Elisabete veio visitar Sérgio, e tratar assuntos com o mesmo, foi orientada que Sérgio estaria em horário de almoço, mas preferiu aguardar.','ABERTO','2025-07-02 17:39:43.869790','2025-07-02 17:39:43.869823',61,8,1,15),(67,'2025-00023','Reunião com Vice Prefeito','Fabio Youseff chegou para reunião agendada com vice Prefeito, ás 15:30!','ABERTO','2025-07-02 18:05:02.024301','2025-07-02 18:14:55.592674',62,9,2,15),(68,'2025-00024','Visita','Caio, acessor do vereador Oswaldo Silva, chega ao gabinete para ofertar ao Vice Prefeito um convite.','ABERTO','2025-07-02 18:17:34.624876','2025-07-02 18:17:34.624901',63,12,2,15),(70,'2025-00026','Requisição de Vaga para idoso/deficiênte','A sra. Maria Aparecida, requer uma vaga de idoso/deficiente na calçada de sua residência, uma vez que não possui garagem e tem muita dificuldade em transportar seu marido, tanto na hora de embarcá-lo quanto desembarcá-lo, já que o mesmo é deficiente e necessita fazer exames e tratamentos constante para melhor qualidade de vida. Em conversa com Sra. Maria Aparecida, esclarece que na verdade o maior problema é sua vizinha da qual possui um brechó na residência e reclama e gera transtornos com a Maria Aparecida criando situações desagradáveis e constrangedora, chegando até chamar o departamento de trânsito para multá-la, pois afirma que as vagas existentes é para uso exclusivo de suas clientes. \nNecessita um atendimento, pois seu pedido da vaga de idoso/deficiente fora negado duas vezes.','ABERTO','2025-07-02 18:55:15.271226','2025-07-02 18:55:15.271258',64,8,1,15),(74,'2025-00028','Reclamação de mal atendimento','Procurou a assessoria da Prefeita para realizar uma reclamação de mal atendimento de funcionário, e demais reclamações.','ABERTO','2025-07-02 20:29:02.906987','2025-07-02 20:29:02.907014',65,8,1,15),(75,'2025-00029','Entrega de Documento','Compareceu a esta recepção sra. Bernadete, a qual gostaria que deixasse um documento para Hugo, informando que o próprio já estaria ciente do que se tratava. Na ocasião, Hugo está em reunião externa junto ao sr Vice Prefeito Teo Cusatis.','ABERTO','2025-07-03 14:41:51.072145','2025-07-03 15:00:17.344111',66,12,2,15),(76,'2025-00030','Esclarecimento sobre as reuniões do programa minha casa minha vida','O sr. Leandro comparece ao gabinete, com algumas dúvidas referente ao programa, uma vez que recebeu uma notificação em seu celular, mas não conseguiu aparecer na reunião, receoso de perder a participação no programa, resolveu comparecer e pedir orientações.','ABERTO','2025-07-03 14:54:57.984559','2025-07-03 14:54:57.984596',67,8,1,15),(77,'2025-00031','Resolução na regulação da remoção de poste','Sr. Júnior comparece pedindo para resolver uma remoção de poste, segundo o munícipe, foi encaminhado a várias secretarias mas que nenhuma conseguiu ajudá-lo com a regulamentação, uma vez que se faz necessário ter a autorização da prefeitura para poder remover o poste. Logo então, como Sérgio não se encontrava, GCM Fernanda orientou a fazer uma ouvidoria, já que o mesmo aguardava e precisava ir embora. O munícipe, acatou a orientação e foi realizar uma ouvidoria, para então conseguir resolver o empecilho e conseguir a autorização para a remoção.','ABERTO','2025-07-03 14:59:36.617168','2025-07-03 14:59:36.617199',68,8,1,15),(78,'2025-00032','Regularização de notificação de limpeza','A sra. Valdeci, comparece para resolver uma questão de seu quintal particular. A munícipe, não soube explicar ao certo a questão se tratava de multa de fiscalização, ou se era apenas uma notificação de limpeza.','ABERTO','2025-07-03 17:01:14.225693','2025-07-03 17:14:40.149222',69,8,1,15),(79,'2025-00033','Visita','Dona Célia compareceu ao gabinete, a pedido da Prefeita Mara, em conversa na igreja do socorro. Paulinho compareceu a recepção para pegar seus dados, e para poder marcar um horário melhor para que a mesma pudesse comp